export function StarButton() {


    const [data, setData] = useState(carddata)
    const handleStar = (value) => {
        console.log(value)
        if (value === "cash" || value === "card") {
            let a = carddata.filter((e) => {
                console.log(e.payment,value)
                return e.payment=== value;
            })
            setData(a);
        }
        else {
            let a = carddata.filter((e) => {
                return Number(e.totalvotes) >= value;
            })
            setData(a);
        }
    
    }
 
  


  const [state, setState] = useState(carddata)
  const handleChange = e => {
    const {name, value} = e.target
    setState( { ...state, [name]: value} )
    }
      
    return <>
        <div>
        <div>
          <input type="text" name="imglink" placeholder="image link" value={state.name} onChange={handleChange} />
        </div>
        <div>
          <input type="text" name="foodname" placeholder="foodTitle" value={state.address} onChange={handleChange} />
        </div>
        <div>
          <input type="text" name="totalvotes" placeholder="rating" value={state.email} onChange={handleChange} />
        </div>
        <div>
          <input type="" name="reviews" placeholder="total votes in format 19/70" value={state.password} onChange={handleChange} />
            </div>
            <div>
          <input type="text" name="costforone" placeholder="Cost of item" value={state.password} onChange={handleChange} />
            </div>
            <div>
          <input type="text" name="categories" placeholder="Categories" value={state.password} onChange={handleChange} />
          </div>
          <button onClick={() => {
          
              setData([...data, state])
              console.log(data);
          }}>add</button>
    </div>
        <div>
            <button onClick={() => handleStar(5)}>stra5</button>
            <button onClick={() => handleStar(4)}>star4</button>
            <button onClick={() => handleStar(3)}>star3</button>
            <button onClick={() => handleStar(2)}>star2</button>
        </div>
       
        <div>
            <div>
                <button onClick={() => handleStar("cash")}>cashonly</button>
                <button onClick={() => handleStar("card")}>cardonly</button>
            
            </div>
       
            <div></div>
            {data.map((e) => {
                return <RestaurentCard card={e} />
            })}
        </div>
    </>
}